import React, {useState, useEffect} from 'react';
import Counter from './counter';
import List from './list';

function App() {

  const movies = [
    {name : '해리포터와 마법사의 돌', index : 2001},
    {name : '해리포터와 비밀의 방', index : 2002},
    {name : '해리포터와 아즈카반의 죄수 ', index : 2004}
  ]

  const renderName = movies.map(movie =>{
    return(
      <List movie={movie} key={movie.name}/>
    );
  })

  return (
    <div className="App">
      {renderName}
    </div>
  );

}

export default App;
